{
    "teacherId": "0e9fb127-088f-4b31-984e-1eaa170d9128",
    "subjectId": "7c1e5982-adac-481e-932b-a0e073af91f2",
    "subjectFamily": "Business and Management",
    "subjectDescription": "Matakuliah ini mengajarkan pentingnya Business Process Reengineering (BPR) dalam konteks bisnis modern, dengan fokus pada karakteristik esensial BPR, pemodelan proses menggunakan IDEF0 dan BPMN, strategi implementasi, analisis, desain, simulasi, dan evaluasi proses, serta manajemen perubahan dan transisi organisasi. Mahasiswa akan dipersiapkan untuk menghadapi tantangan perubahan dalam organisasi dengan pemahaman mendalam tentang BPR dan keterampilan praktis dalam merancang, mengelola, dan mengoptimalkan proses bisnis. This course teaches the importance of Business Process Reengineering (BPR) in the context of modern business, focusing on the essential characteristics of BPR, process modeling using IDEF0 and BPMN, implementation strategies, process analysis, design, simulation, and evaluation, as well as organizational change management and transition. Students will be prepared to confront the challenges of organizational change with a deep understanding of BPR and practical skills in designing, managing, and optimizing business processes.",
